import React, { Component } from "react";
import UserProfile from "../quiz/userProfile";
class Test extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <UserProfile {...props.renderdata} />
      </div>
    );
  }
}
export default Test;
